title:
이런건 후기쓰는건 바로는 좀;; 
잘 받았고 포장 깔끔하고
열심히 먹어보겠습니다~

text:
이런건 후기쓰는건 바로는 좀;; 
잘 받았고 포장 깔끔하고
열심히 먹어보겠습니다~

꾸준히 먹고잇긴한데.. 피부상태는 평소랑 비슷한거 같아요;;
뾰루지같은건 계속 올라오긴하네요 ㅠㅠ
안먹는거보다 나은거 같아서 계속 먹는중입니당

삼십대 중반이 되니 살다가 전혀 느껴보지 못한 건조함과 푸석함을 느끼게 되네요 ;
(지금까지는 왕지성으로 살았습니다.)

한겨울에도 건조함을 모르고 살았는데, 몸소 느끼게 되니 걱정이 되서 구입합니다. 꾸준히 먹어보려고50일 대용량으로 구입했어요 :-)

한달먹어봐서는 글쎄요..;; 잘 모르겠는...
좁쌀같은게 좀 나고해서 먹어봤는데..
역시 피부는 쉬고, 잘자고..맘편한게 쵝오~ ^^;;;;

먹을땐 몰랐는데 안먹으니 푸석한느낌;;
한박스에일주일치..아쉽긴하지만 분명 효과는있는거같아요
뾰루지도 안나고;;
그래서 또 찾아왔네요~^^
